// import "~slick-carousel/slick/slick.css"; 
// import "~slick-carousel/slick/slick-theme.css";



// export default Card;

import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import tshirt from '../../img/t.jpg'
import iphone from '../../img/11.jpg'
import free from '../../img/2971.jpg'
import treeking from '../../img/cp.jpg'
import mac from '../../img/422.jpg'
import jepant from '../../img/jepant.jpg'
import shoo from '../../img/s.jpg'
import ssss from '../../img/ssss.jpg'
import he from '../../img/he.jpg'
import '../../CSS/Style.css'
import "slick-carousel/slick/slick-theme.css";
export default class Slide extends Component {
  render() {
      const settings = {
        
      dots: true,
      infinite: true,
      speed: 600,
      slidesToShow: 5,
      slidesToScroll: 1
    };
    return (
      <div className="">
            <div className="container">
                <div className="row">
                    <div className="col-md-1">
                  
                    </div>
                    <div className="col-md-2">
                        <h2 className="topoffer">Top Offer</h2>
                        <hr className="hrline"/>
                    </div>
            </div>
      </div>
        <Slider {...settings}  className="slickimg productcard ">
        <div >
                    <img src={tshirt} height="140" />
                    <p class="procutname">Black man T-shirt</p>
                    <p className="" id="price">Rs. 1500</p>
                   
                    
                </div>
            <div >
                    <img src={iphone} height="140" />
                    <p className="" id="price">Rs. 150000</p>
          </div>
          <div>
                    <img src={free} height="140" />
                    <p className="" id="price">Rs. 18000</p>
          </div>
          <div>
                    <img src={treeking} height="140" />
                    <p className="" id="price">Rs. 1500</p>
          </div>
          <div>
                    <img src={mac} height="140" />
                    <p className="" id="price">Rs. 1500</p>
          </div>
          <div>
                    <img src={shoo} height="140" />
                    <p className="" id="price">Rs. 1500</p>          
          </div>
          <div>
                    <img src={jepant} height="140" />
                    <p className="" id="price">Rs. 1500</p>
          </div>
          <div>
                    <img src={he} height="140" />
                    <p className="" id="price">Rs. 1500</p>
          </div>
                  
        
        </Slider>
      </div>
    );
  }
}
